import React from 'react';
import { useLocation } from 'react-router-dom';

function MyPlanDetail() {
  const { state } = useLocation();
  const plan = state && state.plan;
  return (
    <div className="travel-plan-details">
      <h2>나의 여행 계획 상세</h2>
      {plan && ( // plan 존재 여부 확인
        <>
          <div className="plan-section">
             <h3>저장 제목</h3>
                <p>{plan.saveTitle}</p>
             </div>
          <div className="plan-section">
            <h3>여행 시작 날짜</h3>
            <p>{plan.firstDate}</p>
          </div>
          <div className="plan-section">
            <h3>여행 종료 날짜</h3>
            <p>{plan.endDate}</p>
          </div>
          <div className="plan-section">
             <h3>출발지</h3>
             <p>{plan.firstPlace}</p>
           </div>
           <div className="plan-section">
             <h3>도착지</h3>
             <p>{plan.endPlace}</p>
           </div>
           <div className="plan-section">
             <h3>할일</h3>
             <p>{plan.todo}</p>
           </div>
        </>
      )}
    </div>
  );
}

export default MyPlanDetail;
